import React from 'react';
// import ReactDOM from 'react-dom';
import Navbar from '../navbar/Navbar';
// import Rellax from 'rellax';
import './header.css';


class Header extends React.Component {
    // componentDidMount() {
    //     this.rellax = new Rellax('.rellax');
    // }

    render() {
        return(
            <React.Fragment>
                <section id='header' className='hero is-fullheight'>
                            <Navbar />
                        <div className='hero-body'>
                            <div className='is-overlay'>
                                <h1 className='title is-2 welcome' id='welcome'>
                                    I'm Ziyad Guluzade
                                </h1>
                                {/* <span> */}
                                <p className='is-4 subtitle' id='about'>I enjoy creating interactive, modern web applications. if you have a desire to work on a project together or just want to have a friendly chat please contact me <a className='contact-link'>here</a></p>
                                {/* </span> */}
                                <div>
                                    <hr className='header-line'></hr>
                                </div>
                            </div> 
                        </div>
                </section>
            </React.Fragment>
        )
    }
}

export default Header;
